import React from "react";
import TextField from "@material-ui/core/TextField";
import Grid from "@material-ui/core/Grid";

const MovieList = () => {
  return (
    <Grid container spacing={4}>
      <Grid item xs={4}>
        <TextField
          type="text"
          id="outlined-basic"
          label="Search"
          variant="outlined"
        />
      </Grid>
    </Grid>
  );
};

export default MovieList;
